import moment from "moment";
import autoTable from "jspdf-autotable";
import { jsPDF } from "jspdf";

var XLSX = require("xlsx");

export const exportExcel = (tableData, tableOptions, fileName) => {
  const newData = [];
  for (const row of tableData) {
    const newRow = {};
    for (const column of tableOptions.columns) {
      if (column.type == "refData") {
        newRow[column.header] = row["refData" + column.field];
      } else if (column.type == "date") {
        newRow[column.header] = moment(row[column.field], "YYYY-MM-DD").format(
          "DD/MM/YYYY"
        );
      } else {
        newRow[column.header] = row[column.field];
      }
    }
    newData.push(newRow);
  }
  var wb = XLSX.utils.book_new(),
    ws = XLSX.utils.json_to_sheet(newData);
  XLSX.utils.book_append_sheet(wb, ws, "MySheet1");
  XLSX.writeFile(wb, `${fileName}.xlsx`);
};

export const exportPdf = (tableData, tableOptions, fileName) => {
  const newData = [];
  const titles = [];

  for (const title of tableOptions.columns) {
    titles.push(title.header);
  }

  for (const row of tableData) {
    const newRow = [];
    for (const column of tableOptions.columns) {
      let newColumn = "";
      if (column.type == "refData") {
        newColumn = row["refData" + column.field];
      } else if (column.type == "date") {
        newColumn = moment(row[column.field], "YYYY-MM-DD").format(
          "DD/MM/YYYY"
        );
      } else {
        newColumn = row[column.field];
      }
      newRow.push(newColumn);
    }
    newData.push(newRow);
  }

  const doc = new jsPDF();

  const font =
    "";

  doc.addFileToVFS("roboto-v18-latin_latin-ext-regular-normal.ttf", font);
  doc.addFont(
    "roboto-v18-latin_latin-ext-regular-normal.ttf",
    "roboto-v18-latin_latin-ext-regular",
    "normal"
  );
  doc.setFont("roboto-v18-latin_latin-ext-regular");

  autoTable(doc, {
    head: [titles],
    body: newData,
    styles: { font: "roboto-v18-latin_latin-ext-regular" },
  });

  doc.save(`${fileName}.pdf`);
};
